import { ContentPage } from '../styled/Components';

const scheduleData = [
	{
		name: "Monday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	},
	{
		name: "Tuesday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	},
	{
		name: "Wednesday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	},
	{
		name: "Friday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	}
];

const Schedule = () => {
	return (
		<ContentPage title="Schedule">
			<div className="flex flex-row justify-center">
				{scheduleData.map(day => <Day day={day} /> )}
			</div>
		</ContentPage>
	);
}

const Day = (props: any) => {
	return (
		<div className="flex flex-col items-center bg-gray-100 border-r-2 border-gray-600 last:border-0">
			<p>{props.day.name}</p>
			<EmptyBlock />
			<EmptyBlock />
			<EmptyBlock />
			<EmptyBlock />
			<EmptyBlock />
			<EmptyBlock />
		</div>
	);
}

const Hour = () => {
	return (
		<div>
		</div>
	);
}

const EmptyBlock = () => {
	return (
		<div className="w-20 h-14 bg-purple-400 m-2">
		</div>
	);
}

export default Schedule;
